    [],nt"revision_timestamp": "2015-06-19T15:28:02.719277",nt"name": "digital-flood-insurance-rate-map-database-anne-arundel-county-maryland-usa",nt"isopen":
    false,nt"url": null,nt"notes": "The Digital Flood Insurance Rate Map (DFIRM)
    Database depicts flood risk information and supporting data used to develop the
    risk data. The primary risk classifications used are the 1-percent-annual-chance
    flood event, the 0.2-percent-annual- chance flood event, and areas of minimal flood
    risk. The DFIRM Database is derived from Flood Insurance Studies (FISs), previously
    published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
    support of the FISs and FIRMs, and new mapping data, where available. The FISs and
    FIRMs are published by the Federal Emergency Management Agency (FEMA). The file
    is georeferenced to earth's surface using the Universal Transverse Mercator Zone
    18 North. The specifications for the horizontal control of DFIRM data files are
    consistent with those required for mapping at a scale of 1:12,000. Coastal study
    data as defined in FEMA Gudelines and Specifications, Appendix D: Guidance for Coastal
    Flooding Analyses and Mapping, submitted as a result of a coastal study. Appendix
    D notes that a variety of analytical methodologies may be used to establish Base
    (1-percent-annual-chance) Flood Elevations (BFEs) and floodplains throughout coastal
    areas of the United States. Appendix D itemizes references for the methodologies
    currently in use by FEMA for specific coastal flood hazards, provides general guidance
    for documentation of a coastal flood hazard analysis, specifies flood hazard analysis
    procedures for the Great Lakes coasts, and outlines intermediate data submissions
    for coastal flood hazard analyses with new storm surge modeling and revised stillwater
    flood level (SWFL). (Source: FEMA Guidelines and Specs, Appendix D Guidance for
    Coastal Flooding Analyses and Mapping, Section D.1)",nt"license_title": null,nt"extras":
